import React from 'react';
import '../styles/termo.css';

export default function Termo() {
 return (
   <div className="paget">
     <div className="cardt">
         <h1>O Projeto Visão Social conta com o aulixio do Governo do Distrito Federal.</h1><br/>
       </div>     
     <div className="ps10">

       <div className="termo">
         <p>Parceria com CDCA. Nessa parceria não contamos o apoio para alimentação e gás de cozinha, materiais de limpeza e higênie, contas de água, luz, internet.Precisamos do seu apoio!</p>
         <p>Telefone: +55 (61) 3485-4568</p>
         <p>WhatsApp: +55 (61) 9 9999-2351</p>
       </div>
     </div>     
   </div>
 );
}
